import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class GenreButton extends React.Component {
	constructor(props) {
		super(props);

	}

	render() {
		return (
			<div className="movie">
				<div className="genre">{this.props.state}</div>
				<div className="genre">{this.props.population}</div>
				<div className="genre">{this.props.peaceful}</div>
				<div className="genre">{this.props.non_peaceful}</div>
				<div className="genre">{this.props.peaceful_per_100K}</div>
				<div className="genre">{this.props.non_peaceful_per_100K}</div>
			</div>
		);
	}
}
